import React, { Component } from 'react';
import './Navbar.css';

export default class Navbar extends Component {
  render() {
    return (
        <div>
        <nav className="layer">
          <ul>
            <li><label htmlFor="pageOne">Home</label></li>
            <li><label htmlFor="pageTwo">About</label></li>
            <li><label htmlFor="pageThree">Blog</label></li>
            <li><label htmlFor="pageFour">Portfolio</label></li>
            <li><label htmlFor="pageFive">Contact</label></li>
          </ul>
        </nav>
        <input type="checkbox" name="hamburger" id="hamburger" />
        <label htmlFor="hamburger">
          <ul><li /><li /><li /></ul>
        </label>

      </div>
    )
  }
}
